import Click from"./Components/Click"
import Prop from "./Components/Prop"
import State from "./Components/State"
import Statehook from "./Components/Statehook";

function App() {
  return (
    <div>
          {/* Components --- Custom HTML Tags */}
      <Fncomp/>
      <ClsComp/>
      <Click/>

            {/* PROPS */}

      <Prop name="John" />
      <Prop name="David" />
      <Prop name="Noel" />

            {/* State */}

       <State/>     
       {/* HOOKS ------ useState() */}

       <Statehook/>


    </div>
  );
}

export default App;
